import { React } from "react";
import Button from '@mui/material/Button';

let ButtonStyle = {
  color: "aliceblue",
  fontSize: "15px",
  width: "8vw",

}

let GitHub = {
  color: "aliceblue",
  fontSize: "15px",
  width: "8vw",
}
let LinKedln = {
  color: "aliceblue",
  fontSize: "15px",
  width: "8vw",
}
const Home = () => {
  const ButtonGitHub = ()=>{
    try {
      window.open("")
      alert("Welcome I am GitHub Profile")
      
    } catch (error) {
      alert("error")
    }
  }
  const ButtonLinKedln = ()=>{
    try {
      window.open("")
      alert("Welcome I am LinKedln Profile")
      
    } catch (error) {
      alert("error")
    }
  }

  return (
    <section class="home" id="home">
      <div class="max-width">
        <div class="home-content">
          <div class="text-1">Hello , My Name is</div>
          <div class="text-2">Tanishq Gupta</div>
          <div class="text-3">And I'm ,<span>a Student</span> </div>
          <div class="text-4">From Lucknow Public College of Professional Studies </div>
        </div>
        <div className="icons">
          <div className="Button">
            <Button style={ButtonStyle} >Download CV</Button>
          </div>
          <div className="logosicons-1">
          <Button style={GitHub} onClick={ButtonGitHub} >GitHub</Button>
          </div>
          <div className="logosicons-2">
          <Button style={LinKedln}  onClick={ButtonLinKedln}>LinKedln</Button>
          </div>
        </div>
      </div>
    </section>
  )
}


export default Home
